import bus from '../common/bus';
export default {
    data() {
        return {
            collapse: false,
            items: [
                {
                    icon: 'el-icon-lx-copy',
                    index: 'shopList',
                    title: '店铺列表'
                },
                {
                    icon: 'el-icon-lx-emoji',
                    index: 'taskList',
                    title: '任务列表'
                },
                {
                    icon: 'el-icon-lx-emoji',
                    index: 'couponList',
                    title: '领券列表'
                },
                {
                    icon: 'el-icon-lx-rank',
                    index: 'addrList',
                    title: '地址列表'
                },
                {
                    icon: 'el-icon-lx-cascades',
                    index: 'Running',
                    title: '订单实时监控'
                },
                {
                    icon: 'el-icon-lx-global',
                    index: 'caseList',
                    title: '订单导出表'
                },
                {
                    icon: 'el-icon-lx-global',
                    index: 'goodsList',
                    title: '货物导出表'
                },
                {
                    icon: 'el-icon-lx-emoji',
                    index: 'OPorder',
                    title: '手工补单'
                },
                {
                    icon: 'el-icon-lx-emoji',
                    index: 'AddrCreate',
                    title: '地址生成'
                }
            ]
        };
    },
    computed: {
        onRoutes() {
            return this.$route.path.replace('/', '');
        }
    },
    created() {
        // 通过 Event Bus 进行组件间通信，来折叠侧边栏
        bus.$on('collapse', msg => {
            this.collapse = msg;
            bus.$emit('collapse-content', msg);
        });
    }
};
